 &lt;h1 id=&#34;介绍&#34;&gt;&lt;a href=&#34;#介绍&#34; class=&#34;headerlink&#34; title=&#34;介绍&#34;&gt;&lt;/a&gt;介绍&lt;/h1&gt;&lt;p&gt;OVH，全名OVH Groupe SAS，法国云端运算公司，提供有VPS、专有服务器及其他Web服务。OVH拥有一个全球面积最大的数据中心。[5]它是欧洲最大的互联网托管服务提供商[6] [7]，也是全球第三大基于物理服务器的托管服务提供商。[8]该公司由Klaba家族于1999年成立[1]，总部位于法国鲁贝。[9]OVH是按法国法律成立的简化股份制公司。&lt;/p&gt;
&lt;h1 id=&#34;历史与成长&#34;&gt;&lt;a href=&#34;#历史与成长&#34; class=&#34;headerlink&#34; title=&#34;历史与成长&#34;&gt;&lt;/a&gt;历史与成长&lt;/h1&gt;&lt;p&gt;Octave Klaba于1999年11月[1]在三个家庭成员（Henry，Haline和Miroslaw）的帮助下成立。&lt;/p&gt;
&lt;p&gt;2016年10月，OVH据报筹集了2.5亿美元以进一步扩大国际业务。[10]该轮融资使OVH的估值超10亿美元。据报道，OVH在2016财年的收入为3.2亿欧元。 OVH于2018年宣布自2021年开始将投资增加三倍的五年计划。[11]&lt;/p&gt;
&lt;p&gt;2017年6月，OVH 通过债务融资再次募集了4亿欧元资金，本轮由 JP Morgan Chase 领投，CIC Nord Ouest和Banque Commerciale du Marché Nord Europe跟投。[12]&lt;/p&gt;
&lt;p&gt;截至2018年，OVH已在19个国家&amp;#x2F;地区拥有27个数据中心，托管30万台服务器。[13]该公司在许多欧洲国家以及北美洲、非洲和新加坡提供本地化服务，如客户服务办公室。[14]截至2019年，OVH是世界上最大的云计算提供商之一，拥有超过一百万客户，且是世界上最大的OpenStack部署之一。[15]&lt;/p&gt;
